// 將opcode mapping 成一個integer
void create_table(SuffixTree *st, stringstream &ss)
{
    while (!ss.fail())
    {
        string temp;
        ss >> temp;
        if (temp.empty())
            continue;
        if (table_num[temp] == 0)
        {
            table_num[temp] = table_num.size() + 1;
            table_name[table_num[temp]] = temp;
        }
        st->number_sequence.push_back(table_num[temp]);
    }
    return;
}

